var UrlServerless = "http://localhost:5567/api/items?q=";

function get(dispatch, type, textFind){

    var queryUrl = UrlServerless+textFind;

    fetch(queryUrl)
    .then(data => data.json())
    .then(data => { dispatch({ type, data}) })
    .catch(function (error) {console.log("Error cargando datos " + error);});      
}

const DAO = { get }

export default DAO;
